import React from "react";
import Content from "../components/content";
import { useEffect, useState } from "react";
import chelsea from "../images/Chelsea_FC.svg.png"
function Football(){
    const [footballData,setFootball] = useState(null);
    useEffect(()=>{
        const fetchFootballData= async ()=>{
            const response = await fetch('/sports/Football');
            const json = await response.json();

            if(response.ok){
                setFootball(json);
            }
        }
        fetchFootballData();
    },[])
    return(
        <div className="football-content">
        {footballData?footballData.map((data)=>{
            return <Content TeamName={data.teamName} currentFixture={data.nextFixture} imageURL={chelsea}/>
        }):<p>Loading</p>}

        </div>
    )
}

export default Football;
